// import { SelectBox } from "../components/SelectBox/index";
// import { Img } from "../components/Img/index";
// import { Text } from "../components/Text/index";
// import { Button } from "../components/Button/index";

import Table from "components/Table/Table";
import "./style.css";

export default function RegimenDetails() {
  const data = [
    { Medication: 1, Dose: "Alice", Route: 30, Instructions: "gg" },
    { Medication: 2, Dose: "Bob", Route: 35, Instructions: "gg" },
    { Medication: 3, Dose: "Charlie", Route: 40, Instructions: "gg" },
    { Medication: 3, Dose: "Charlie", Route: 40, Instructions: "gg" },
    { Medication: 3, Dose: "Charlie", Route: 40, Instructions: "gg" },
    { Medication: 3, Dose: "Charlie", Route: 40, Instructions: "gg" },
    { Medication: 3, Dose: "Charlie", Route: 40, Instructions: "gg" },
    { Medication: 3, Dose: "Charlie", Route: 40, Instructions: "gg" },
  ];

  return (
    <>
      <div className="cycles">
        <p>Cycles</p>
        <div className="row">
          <input type="radio" />
          <span>Every</span>
        </div>
        <div className="row">
          <input type="radio" />
          <span>Day</span>
        </div>
        <button>Check</button>
      </div>
      <div className="medications">
        <p>Mediactions</p>
        <div className="premediaction">
          <p>PreMediactions</p>
          <Table data={data} />
        </div>
        <div className="chemotherapy">
          <p>ChemoTherapy</p>
        </div>
      </div>
      <div className="notes">
        <p>Physician Notes</p>
        <input type="text" placeholder="Add your notes here..." />
      </div>
    </>
  );
}
